import { Dropdown, DropdownButton } from 'react-bootstrap';
import React from 'react';
import classes from './cbxView.module.css';
import Modal from '../../UI/Modal/Modal';

const cbxView = (props) => {

    const dropDown = 
    <div>
    <DropdownButton id = "dropdown-basic-button" title = "Select CBx Goal">
        <Dropdown.Item onSelect = {() => {
            props.changeTable(0);
        }} >{props.clientArray[7]}</Dropdown.Item>
        <Dropdown.Item onSelect = {() => {
            props.changeTable(1);
        }}>{props.clientArray[8]}</Dropdown.Item>
        <Dropdown.Item onSelect = {() =>{
            props.changeTable(2);
        }}>{props.clientArray[9]}</Dropdown.Item>
        <Dropdown.Item onSelect = {() => {
            props.changeTable(3);
        }}>{props.clientArray[10]}</Dropdown.Item>
        <Dropdown.Item onSelect = {() => {
            props.changeTable(4);
        }}>{props.clientArray[11]}</Dropdown.Item>
    </DropdownButton>
    <button onClick = {props.openModal}>Open Chart</button>
    </div>;

    return(
        <div>
            {dropDown}
            <Modal show = {props.showChart} modalClosed = {props.closeTable}>
                <div className = {classes.CBxBoxArea}>
                    <textarea readOnly value = "1"></textarea>
                    <textarea readOnly value = "2"></textarea>
                    <textarea readOnly value = "3"></textarea>
                    <textarea readOnly value = "4"></textarea>
                    <textarea readOnly value = "5"></textarea>
                    <textarea readOnly value = "Date"></textarea>
                    {props.tableMaker()}
                    <textarea></textarea>
                    <textarea></textarea>
                    <textarea></textarea>
                    <textarea></textarea>
                    <textarea></textarea>
                    <textarea></textarea>
        <button onClick = {props.closeTable}>Close</button>
                </div>
            </Modal>
        </div>
    );

}

export default cbxView;
